function trimKeys(obj) {
  if (obj instanceof Array) {
    return obj.map((item) => trimKeys(item));
  } else if (obj instanceof Object) {
    return Object.keys(obj).reduce((result, key) => {
      const trimmedKey = key.trim();
      result[trimmedKey] = trimKeys(obj[key]);
      return result;
    }, {});
  } else {
    return obj;
  }
}

function selectCSVMapper(accountName) {
  const csvMaps = {{getCSVProfiles.data}}
  let selectedMap = csvMaps.filter(csvMap => csvMap.accounts.some(account => account.includes(accountName)))[0];
  delete selectedMap.name;
  delete selectedMap.accounts;
  return selectedMap;
}

function deleteBlobsByCategory(blobs) {
  const categoriesToDelete = ['Reinvestment', 'Sweep in', 'Buy', 'Sweep out'];
  return blobs.filter(blob => !categoriesToDelete.includes(blob.category));
}

function adjustTransactions(blobs) {
  const trimmedData = trimKeys(blobs);
  const csvMap = selectCSVMapper({{transactionsCSVAccountInput.value}});

  const cleansedTransactions = trimmedData.map(blob => {
    return Object.keys(csvMap).reduce((newBlob, key) => {
      newBlob[key] = blob[csvMap[key]];
      return newBlob;
    }, {});
  });

  const dateAdjustedTransactions = cleansedTransactions.map(blob => {
    console.log(blob.date);
    const dateParts = blob.date.split('/');
    let newDate = blob.date;
    if (dateParts.length === 3 && dateParts[2].length === 4) {
      const year = dateParts[2];
      const month = dateParts[0].padStart(2, '0');
      const day = dateParts[1].padStart(2, '0');
      newDate = `${year}-${month}-${day}`;
    }
    console.log(blob.account);
    const account = blob.account ? blob.account : {{transactionsCSVAccountInput.value}};
    return {
      ...blob,
      date: newDate,
      account: account
    };
  });

  return deleteBlobsByCategory(dateAdjustedTransactions);
}

const jsonList = {{transactionsCSVFileInput.parsedValue[0]}};
console.log({{transactionsCSVFileInput.parsedValue[0]}})
const adjustedTransactions = adjustTransactions(jsonList);

return adjustedTransactions;

