    creditNumberInput10
  ]
  const debitAccountSelects = [
    debitAccountSelect1, 
    debitAccountSelect2, 
    debitAccountSelect3, 
    debitAccountSelect4,
    debitAccountSelect5,
    debitAccountSelect6,
    debitAccountSelect7,
    debitAccountSelect8,
    debitAccountSelect9,
    debitAccountSelect10
  ]
  const debitNumberInputs = [
    debitNumberInput1, 
    debitNumberInput2, 
    debitNumberInput3, 
    debitNumberInput4,
    debitNumberInput5,
    debitNumberInput6,
    debitNumberInput7,
    debitNumberInput8,
    debitNumberInput9,
    debitNumberInput10
  ]

  //Clear all previous values
  for (let i = 0; i < creditAccountSelects.length; i++) {
    creditAccountSelects[i].clearValue();
    creditNumberInputs[i].clearValue();
    debitAccountSelects[i].clearValue();
    debitNumberInputs[i].clearValue();
  };
  journalEntryNoteInput.clearValue();


  //Grab current row data
  const selectedRow = transactionsTable.selectedRow.data;
  transactionTypeSelect.setValue(selectedRow.type || selectedRow.suggested_type);

  //Check if already has journal entries attached
  const journalEntry = selectedRow.journal_entry
  if (journalEntry !== null) {

    journalEntryNoteInput.setValue(journalEntry.description);
    transactionDate.setValue(journalEntry.date);
    const debits = [];
    const credits = [];

    for (const journalEntryItem of journalEntry.journal_entry_items) {
      if (journalEntryItem.type === "debit") {
        debits.push(journalEntryItem);
      } else if (journalEntryItem.type === "credit") {
        credits.push(journalEntryItem);
      }
    }

    for (let i = 0; i < debits.length; i++) {
      debitAccountSelects[i].setValue(debits[i].account)
      debitNumberInputs[i].setValue(debits[i].amount)
    };

    for (let i = 0; i < credits.length; i++) {
      creditAccountSelects[i].setValue(credits[i].account)
      creditNumberInputs[i].setValue(credits[i].amount)
    };
    return;
  }

  const amount = Math.abs(selectedRow.amount);
  debitNumberInput1.setValue(amount); 
  creditNumberInput1.setValue(amount);

  var selectAccountFill; // Where the *source* of the transaction goes
  var selectOppositeFill; // Where the opposite account of the transaction goes
  var autoFocusSelect; // Which select field we autofocus to — only autofocus if there is no OppositeFill and on that side

  const debitsDecreaseAccountTypes = ['liability','equity']
  if (debitsDecreaseAccountTypes.includes(selectedRow.account.type)) {
    if (selectedRow.amount < 0) {
      selectAccountFill = creditAccountSelect1;
      selectOppositeFill = debitAccountSelect1;
      autoFocusSelect = debitAccountSelect1;
    } else {
      selectAccountFill = debitAccountSelect1;
      selectOppositeFill = creditAccountSelect1;
      autoFocusSelect = creditAccountSelect1;
    }
  } else {
    if (selectedRow.amount < 0) {
      selectAccountFill = creditAccountSelect1;
      selectOppositeFill = debitAccountSelect1;
      autoFocusSelect = debitAccountSelect1;
    } else {
      selectAccountFill = debitAccountSelect1;
      selectOppositeFill = creditAccountSelect1;
      autoFocusSelect = creditAccountSelect1;
    }
  }
  transactionDate.setValue(selectedRow.date);
  selectAccountFill.setValue(selectedRow.account_name);
  if (selectedRow.suggested_account) {
    selectOppositeFill.setValue(selectedRow.suggested_account.name);
  } else {
    autoFocusSelect.focus();  
  }

  if (selectedRow.linked_transaction.account.name) {
    selectOppositeFill.setValue(selectedRow.linked_transaction.account.name);
  }

}

